package com.wsc2018091701;

public class List {
	private String name;
	private String sex;
	public List(String name, String sex) {
		
		this.name = name;
		this.sex = sex;
	}
	public List() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public String getSex() {
		return sex;
	}
	public void setSex(String sex) {
		this.sex = sex;
	}

	
}
